import { HTTP_URL } from "../App/Slices/baseurl";
import axios from "axios";

export const updateLaneList = (lane:string,list:string[][]) => {
   axios.put(`${HTTP_URL}update${lane}list/`,list).catch((err) => {
      console.log(err)})
   console.log(`${HTTP_URL}update${lane}list/`)
   console.log(list)
}
